ATTN: Tribe Nation! ğŸˆğŸ“£ ğŸ¥ Dobyns-Bennett High School has announced guidelines that will be in place at J. Fred Johnson Stadium during the 2020 football season. Please take note of the following and watch this video:

â¡ï¸ Tickets to D-B football games will NOT be sold on game night at the stadium. Purchase tickets ($7 each) at the D-B Activities Office Monday-Thursday from 8 a.m. - 2 p.m. and on Friday from 8 a.m. to noon;
â¡ï¸ Seating will be limited to 50% capacity;
â¡ï¸ Temperature checks required upon entry;
â¡ï¸ Face mask required at all times;
â¡ï¸ Practice social distancing;
â¡ï¸ Children 14-years-old and younger will not be admitted without an adult and must be supervised at all times;
â¡ï¸ Two D-B student sections provided;
â¡ï¸ D-B Band will utilize the bleachers on the visitors' side and end zone;
â¡ï¸ Game-night concessions will be prepackaged;
â¡ï¸ Fans from either team will not be allowed on the field after the game;
â¡ï¸ This season will be live streamed for free on YouTube - link on athletics.k12k.com each Friday.

Thank you for supporting our student athletes this season. #rolltriberoll

